COMPLEX_HTML = """
<div class="container">
    <nav class="navigation">
        <ul style="list-style: none;">
            <li class="nav-item"><a href="#home">Home</a></li>
            <li class="nav-item"><a href="#about">About</a></li>
        </ul>
    </nav>
    <main>
        <h1 class="title" data-custom="value">Welcome</h1>
        <p style="color: blue;">This is a <strong>test</strong> paragraph.</p>
        <div></div>
        <img src="data:image/jpeg;base64,/9j/" alt="Embedded image">
        <script>console.log("Hello");</script>
    </main>
</div>
"""

@pytest.fixture
def sample_html():
    """Fixture providing sample HTML for testing."""
    return SAMPLE_HTML

@pytest.fixture
def complex_html():
    """Fixture providing complex HTML for testing."""
    return COMPLEX_HTML

def normalize_html(html: str) -> str:
    """
    Normalize HTML string for consistent comparison.
    
    Args:
        html: HTML string to normalize
        
    Returns:
        Normalized HTML string with consistent whitespace and formatting
    """
    if not html.strip():
        return ""
    soup = BeautifulSoup(html, 'html.parser')
    return ' '.join(soup.get_text().split())

def test_none_mode(sample_html):
    """Test NONE mode returns original HTML unchanged."""
    result = clean(sample_html, CleaningMode.STANDARD)

    with open('./cleaned_result.html', 'a') as f:
        f.write(result)
        f.write('\n')

    print(result)


def test_ultimate_mode(complex_html):
    """Test ULTIMATE mode removes container tags and preserves essential content."""
    result = clean(complex_html, CleaningMode.ULTIMATE)
    
    # Check that container tags are removed
    assert '<div class="container">' not in result
    assert '<nav' not in result
    
    # Check that essential content is preserved
    assert '<a href="#home">Home</a>' in result
    assert '<strong>test</strong>' in result
    
    # Check that styles and custom attributes are removed
    assert 'style=' not in result
    assert 'data-custom=' not in result
    
    # Check that empty tags are removed
    assert '<div></div>' not in result
    
    # Check that scripts and embedded images are removed
    assert '<script>' not in result
    assert 'data:image/jpeg;base64' not in result

def test_text_content_focused_mode(complex_html):
    """Test TEXT_CONTENT_FOCUSED mode extracts only text content."""
    result = clean(complex_html, CleaningMode.TEXT_CONTENT_FOCUSED)
    expected_text = "Home About Welcome This is a test paragraph."
    assert normalize_html(result) == normalize_html(expected_text)

def test_thorough_mode(complex_html):
    """Test THOROUGH mode removes classes but keeps structure."""
    result = clean(complex_html, CleaningMode.THOROUGH)
    
    # Check that class attributes are removed
    assert 'class=' not in result
    
    # Check that structure is preserved
    assert '<nav>' in result or '<nav/>' in result
    assert '<main>' in result or '<main/>' in result
    
    # Check that links are preserved
    assert '<a href="#home">' in result

def test_standard_mode(complex_html):
    """Test STANDARD mode preserves classes but removes styles."""
    result = clean(complex_html, CleaningMode.STANDARD)
    
    # Check that class attributes are preserved
    assert 'class="container"' in result
    assert 'class="navigation"' in result
    
    # Check that styles are removed
    assert 'style=' not in result

def test_google_search_result_mode(complex_html):
    """Test GOOGLE_SEARCH_RESULT mode preserves links and text."""
    result = clean(complex_html, CleaningMode.GOOGLE_SEARCH_RESULT)
    
    # Check that only links and text are preserved
    assert '<a href="#home">Home</a>' in result
    assert '<a href="#about">About</a>' in result
    assert 'Welcome' in result
    
    # Check that other elements are removed
    assert '<nav>' not in result
    assert '<main>' not in result
    assert '<h1>' not in result

def test_empty_input():
    """Test cleaning empty or whitespace-only input."""
    assert clean("", CleaningMode.STANDARD) == ""
    assert clean("   ", CleaningMode.STANDARD) == ""
    assert clean("\n\t", CleaningMode.STANDARD) == ""

def test_malformed_html():
    """Test cleaning malformed HTML input."""
    malformed_html = "<div>Unclosed div <p>Unclosed paragraph <span>Text</div>"
    result = clean(malformed_html, CleaningMode.STANDARD)
    assert "Text" in result

def test_nested_empty_tags():
    """Test removal of nested empty tags."""
    nested_empty = "<div><span><p></p></span><p>Content</p></div>"
    result = clean(nested_empty, CleaningMode.STANDARD)
    assert "<p>Content</p>" in result
    assert "<p></p>" not in result
    assert "<span></span>" not in result

def test_comment_removal(sample_html):
    """Test that HTML comments are removed."""
    result = clean(sample_html, CleaningMode.STANDARD)
    assert "<!-- This is a comment -->" not in result

def test_script_removal(sample_html):
    """Test that script tags are removed."""
    result = clean(sample_html, CleaningMode.STANDARD)
    assert "<script>" not in result
    assert "alert" not in result

def test_embedded_image_removal():
    """Test removal of embedded base64 images."""
    html_with_embedded = '<img src="data:image/jpeg;base64,/9j/4AAQ" alt="test">'
    result = clean(html_with_embedded, CleaningMode.STANDARD)
    assert "data:image/jpeg;base64" not in result

def test_whitespace_cleaning():
    """Test that whitespace is properly cleaned."""
    messy_html = """
            <div>
                Multiple    Spaces
                And
                Lines
            </div>
        """
    result = clean(messy_html, CleaningMode.STANDARD)
    assert "Multiple Spaces And Lines" in normalize_html(result)